import React from "react";
import { Divider, PageHeader, Row, Space, Statistic } from "antd";
import { connect } from "react-redux";
import { firestoreConnect } from "react-redux-firebase";
import { compose } from "redux";
import Container from "../../common/container";
import {
    BarChart, Bar, Cell, XAxis, YAxis, CartesianGrid, Tooltip, Legend,
} from 'recharts';

const data = [
    {
        name: 'Page A', uv: 4000, pv: 2400, amt: 2400,
    },
    {
        name: 'Page B', uv: 3000, pv: 1398, amt: 2210,
    },
    {
        name: 'Page C', uv: 2000, pv: 9800, amt: 2290,
    },
    {
        name: 'Page D', uv: 2780, pv: 3908, amt: 2000,
    },
    {
        name: 'Page E', uv: 1890, pv: 4800, amt: 2181,
    },
    {
        name: 'Page F', uv: 2390, pv: 3800, amt: 2500,
    },
    {
        name: 'Page G', uv: 3490, pv: 4300, amt: 2100,
    },
];

const Dashboard = () => {

    return (
        <div>
            <PageHeader title="Overview" />
            <Container>
                <Row style={{ justifyContent: 'space-around' }}>
                    <Statistic title="Total Vendido" value="" />
                    <Statistic title="Unidades Vendidas" value="" />
                    <Statistic title="Clientes" value="" />
                </Row>
            </Container>
            <Divider/>
            <Container>
                <BarChart
                    width={500}
                    height={300}
                    data={data}
                    margin={{
                        top: 5, right: 30, left: 20, bottom: 5,
                    }}
                >
                    <CartesianGrid strokeDasharray="3 3" />
                    <XAxis dataKey="name" />
                    <YAxis />
                    <Tooltip />
                    <Legend />
                    <Bar dataKey="pv" fill="#8884d8" />
                    <Bar dataKey="uv" fill="#82ca9d" />
                </BarChart>
            </Container>
        </div>
    );
};

const mapStateToProps = (state) => ({
    ordersData: state.firestore.ordered.Orders,
});

export default compose(
    connect(mapStateToProps),
    firestoreConnect([{ collection: "Orders" }])
)(Dashboard);
